import supertest from 'supertest'
import {expect} from 'chai'
import {RandomUserdata} from '../helpers/common';

const request = supertest('https://gorest.co.in/public-api/');
const TOKEN = 'f23c96ab955134d34fb15a05c891320a81c0a6a309c9f481604ee380d19bef872';

describe('Users', () => {
    it('GET /Users', async () => {
        const res = await request
            .get('users?access-token=${TOKEN}');
        console.log(res.body);
    });

    it('GET /Users Info using based on Gender Female filter',() => {
        return request.get('users?access-token=${TOKEN}&gender=Female&page=2').then((res) => {
                            expect(res.body.data).to.not.be.empty;
                            // console.log(res.body);
                            res.body.data.forEach((data) => {
                                expect(data.gender).to.eq('Female');
                                console.log(" Id :: " + data.id + " Gender :: " + data.gender);        
                            });
                        });
    });
 });

describe('Users', () => {
    it('GET /Users', async() => {
        const res = await request.get('/users?access-token=${TOKEN}&gender=Female&page=2');
        console.log(res.body);
            expect(res.body.data).to.not.be.empty;
            expect(res.body.code).to.eq(200);
            res.body.data.forEach(value => {
                expect(value.gender).to.eq('Female');
        });
    })

    it.only('POST /users', async() => {
        let sex = 'Male';
        // const data = {
        //     email: `test-${Math.floor(Math.random() * 9999)}@email.com`,
        //     name: 'Hi',
        //     gender: sex
        // };
        //console.log(" gender :: " + data.gender);

        console.log(" Random User data :: " + RandomUserdata.userData);
        const res =  await request.post('/users')
                                    .set('Authorization', `Bearer ${TOKEN}`)
                                    .send(RandomUserdata.userData);
        console.log(res.body);                        
        // expect(res.body.code).to.eq(204);
        // expect(res.body.data).to.not.be.empty;
        // expect(res.body.data).to.deep.include(data);
    });
});

describe('POSTS', () => {
    it('POST /Users', () => {
        const reqbody = {
            email: `test-${Math.floor(Math.random() * 9999)}@maili.co`,
            name: 'Hitest',
            gender: 'Male',
            status: 'Inactive'
        };
        return request.post('users')
                     .set('Authorization', `Bearer ${TOKEN}`)
                     .send(reqbody)
                     .then((res) => { 
                        console.log(res.body); 
                        expect(res.body.data).to.not.be.empty;
                        // reqbody.email = "updateemaail.com"; // for -ve test
                        expect(res.body.data.email).to.deep.include(reqbody);
                });                            
    });

    it('DELETE /User', () => {
        return request.delete('users/17')
            .set('Authorization', `Bearer ${TOKEN}`)
            .then(res => {
                expect(res.body.data).to.be.eq(null);
            });
    });
});

