import supertest from 'supertest';
import {expect} from 'chai';

var request = supertest('https://reqres.in');

describe('API Tests', () => {

    it('GET Req test', async() => {
        return await request.get('/api/users?page=2').then(res => {
            console.log(res.body);
            expect(res.body.data).to.not.be.empty;
        });
    });

    it('GET Req test to get specific User data', async() => {
        const res = await request.get('/api/users/9').then(res);
        expect(res.body.data).to.not.be.empty;
        console.log(res.body);
        expect(res.body.data.id).to.eq(9);
    });

    it('POST Req test', async() => {
        const reqBody  = {
            "name": "John",
            "job": "Tester"
        };
        const res = await request.post('/api/users')
                                  .send(reqBody)
                                  .then(res);
        expect(res.body).to.not.be.empty;
        console.log(res.body);
        expect(res.body).to.deep.include(reqBody);
    });

    // it('Delete Req test to delete User data', async() => {
    //     const res = await request.delete('/api/users/9').then(res);
    //     expect(res.body).to.not.be.empty;
    //     console.log(res.body);
    //     expect(res.body.data).to.eq(undefined);
    // });

    it('POST Req test to create New User', async() => {
        const reqBody = 
        {
            "email": "test@qa"
        };
        const res = await request.post('/api/register')
                                  .send(reqBody)
                                  .then(res);
        console.log(res.body);
        expect(res.body.error).to.eq('Missing password');
    });
})

